import React from "react";

function Note(props) {
    return (
    <div className = "note">
        <div className="titleContainer">
            <h3>23 June, 2019</h3>
            <button>-</button>
        </div>
        <div>
            <span className = "dot"></span>
            <h1>{props.title}</h1>
            <p>{props.content}</p>
        </div>
    </div>
    );
}

export default Note
